function SortRoads(roads) {
    var resArray = [];
    resArray.length = roads.length;
    var rankCnt = {};
    for (var k = 0; k < roads.length; k++) {
        var sort_rank = roads.feature(k).properties.sort_rank;
        if (rankCnt[sort_rank]) {
            rankCnt[sort_rank]++;
        } else {
            rankCnt[sort_rank] = 1;
        }
    }
    var rankArr = [];
    for (var rank in rankCnt) {
        rankArr.push({ rank: rank, cnt: rankCnt[rank] });
    }
    rankArr.sort(function (a, b) {
        return a.rank - b.rank;
    });
    for (var k = 1; k < rankArr.length; k++) {
        rankArr[k].cnt += rankArr[k - 1].cnt;
        rankCnt[rankArr[k].rank] = rankArr[k].cnt;
    }
    for (var k = 0; k < roads.length; k++) {
        var ft = roads.feature(k);
        var sort_rank = ft.properties.sort_rank;
        var cnt = rankCnt[sort_rank] - 1;
        resArray[cnt] = ft;
        rankCnt[sort_rank]--;
    }
    return resArray;
}

