/**
 * 城市列表分组
 */
function sortCity() {
    var map = new Map();

    for (var key in cityList) {
        var city = cityList[key];
        var spell = city.spell;
        var spellTop = spell.substr(0, 1);
        if (!map.has(spellTop)) {
            map.set(spellTop, [city]);
        } else {
            map.get(spellTop).push(city);
        }
    }
    var keys = Array.from(map.keys()).sort();
    var GroupsList = [];

    for (var key in keys) {
        var citys = map.get(keys[key]).sort(function (a, b) {
            return a.spell > b.spell;
        });
        var adcodes = [];
        for (var city in citys) {
            adcodes.push(citys[city].adcode);
        }
        GroupsList.push({
            id: keys[key], //分组ID，需唯一
            title: keys[key], //分组标题
            anchorTitle: keys[key], //右侧锚点标题，通常单个字符
            adcodes: adcodes
        });
    }
}

function _search(keywords) {
    if (!keywords || keywords.length == 0) return customGroup;
    keywords = keywords.toLowerCase();
    console.log(keywords);
    var list = [];
    for (var key in customGroup) {
        var group = null;
        var adcodes = customGroup[key].adcodes;
        for (var adcode in adcodes) {
            var city = cityList[adcodes[adcode]];
            if (city.spell.toLowerCase().indexOf(keywords) != -1 || city.name.indexOf(keywords) != -1) {
                if (!group) {
                    var id = city.spell.substr(0, 1);
                    group = {
                        id: id,
                        title: id,
                        anchorTitle: id,
                        adcodes: []
                    };
                }
                console.log({ spell: city.spell, name: city.name });
                group.adcodes.push(adcodes[adcode]);
            }
        }
        if (group) {
            list.push(group);
        }
    }
    return list;
}

